  true,\n\t\"url\": null,\n\t\"notes\": \"EDFacts Techonology, 2010-11 (EDFacts Tech:2010-11),
  is one of 17 'topics' identified in the EDFacts documentation (in this database,
  each 'topic' is entered as a separate study). EDFacts Tech:2010-11 (ed.gov/about/inits/ed/edfacts)
  annually collects cross-sectional data from states about techonology education at
  the school, Local Education Agency, and State Education Agency levels. Key statistics
  produced from EDFacts Tech:2010-11 are from four data groups with information on
  8th Grade Techonology Literacy, Internet Access, Integrated Technology Status, and
  Personnel Skilled in Technology. For the purposes of this system, data groups are
  referred to as 'variables', as a result of the structure and format of EDFacts'
  data.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\": [{\n\t\t\"key\":
